import Login from "./Login";
import Registration from "./Registration";
import ToDo from "./ToDo";

const App = () => {

  return (
    <div className='App'>
      <header className='App-header'>
        <h1>Главная</h1>
      </header>
      <ToDo/>
      <Login/>
      <Registration/>
    </div>
  )
}

export default App;
